import React from 'react';
import {Link} from 'react-router-dom';

const Homepage= () => (
    <div className="home-hero">
      <h1>Sea un buen nutrizionistaz</h1>
      <h4>¿Nuevo en Nutric.io?</h4>
      <Link to="/signup" className="btn btn-danger">
        Regístrate
      </Link>
    </div>
  )
 export default Homepage
